import React, {useState} from 'react';
import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Dashboard from './Dashboard';
import Login from './Login';
import { AppBar, Toolbar, Box} from '@mui/material';

function App() {


  return (
    <div className="wrapper">
      <AppBar>
        <Toolbar>
          <h1>GMCdez</h1>
          <Link>Home</Link>
          <Link>Login</Link>
        </Toolbar>
        </AppBar>
        <Box sx={{height:"60px"}}>
          </Box>

      <BrowserRouter>
        <Switch>
          <Route path="/dashboard">
            <Dashboard />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}
